    data: |
      SELECT ALL col2 * col2 + col2 col0 FROM tab2 WHERE NOT ( CAST ( - 77 AS REAL ) * col0 - - - 40 + - col1 + + 94 ) >= + 56 AND NOT ( 74 - 40 ) IS NULL;
  - name: tab2

outputs:
  - name: q12301.out
    data: |
      1640
      3422
      552
